import React from 'react'
import Navbar from '../components/navbar/navbar'
import Sidebar from '../components/sidebar/sidebar'


const sidebar_options = {
    blank: "true"
}
const MultiViewPage = () => {
    return(
        <React.Fragment>
            <Navbar />
            <Sidebar input={sidebar_options}/>
        </React.Fragment>
    );
}

export default MultiViewPage
